(function(){Vue.component("convos-message-error",{mixins:[Convos.mixin.message],template:"<div :class=\"classNames()\" class=\"convos-message error\">\n    <span class=\"secondary-content ts\" v-tooltip=\"msg.ts.toLocaleString()\">{{msg.ts | timestring}}</span>\n    <a @click.prevent=\"insertIntoInput\" class=\"title\" href=\"#{{msg.from}}\">{{msg.from}}</a>\n    <div class=\"error\">{{msg.message}}</div>\n  </div>\n"})})();